.
.
I was getting kicked out of culinary school. I didn‚Äôt have the money to make the payments so they discontinued my attendance. I was pretty defeated..
.
.
Then one day I realized that I wasn‚Äôt going to let that stop me! I continued to work hard and find other chefs that could teach me. That hard work led to me working all the way to the top, becoming an Executive Chef at 24 for a wine bar in Southern Oregon.  That is when I really fell in love with bread and the process in its entirety! 
.
.
Completely self taught, finding this newly found passion, I started a small scale bread program at this restaurant and made all the bread in house using nothing but a sourdough starter I started.
.
.
Two years later, I decided to move further north to pursue bread even further, which is when I decided to start my online bread shop @true__bakery 
.
.
From culinary school drop out to owning my first online bread shop I still felt there was something missing.. then it hit me. My passion to teach people is so prominent that I needed to show everyone I could, how to do the things I‚Äôve worked toward for years. There is no greater joy than seeing that üí° go off when someone finally grasps what you taught them.  And that has now become my mission:  to show people how make natural bread WITHOUT all the preservative shit that the big bread companies put in their breads! Join me today and click the link in my bio and let‚Äôs get to making bread the old way, the natural way, the only way it should be made!
.
